import React, { Component } from "react";

class Name extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <form>
          <label>
            Name :
            <input type="text" onSubmit={this.props.setName} />
          </label>
          <button type="submit">Add</button>
        </form>
      </div>
    );
  }
}

export default Name;
